import "./Header.css";

export function Button({text}){
  return(
    <button>{text}</button>
  )
}

export default function Header({title, buttons}){

       return (
        <div className="flex bg-bud bg-cover h-1/4 p-10 h-120 md:h-1/3 lg:h-1/3 xl:h-4/5 bg-center">
          <div className="bg-transparent flex flex-col justify-start w-min xl:m-40">

              <p id="header-title" className="text-2xl text-green-400 font-bold p-4 md:text-4xl md:p-10 xl:text-9xl">
                {title}
              </p>
              <div id="btn-container" className="flex justify-around">
                <div className="bg-purple-600 p-1 rounded text-white text-sml">
                  <Button text='Login'/>
                </div>
                <div className="bg-purple-600 p-1 rounded text-white text-sml">
                  <Button text='Signup'/>
                </div>




              </div>
          </div>
        </div>
       )
}
